import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { eventGen, rudderKey } from './eventGenerate';

class App extends Component {
  constructor(props) {
    super(props);
  }

  componentDidMount() {
    if (rudderKey != null && rudderKey !== '' && !rudderKey.startsWith('placeholder')) {
      var methods = [
        "load",
        "page",
        "track",
        "identify",
        "trackEvent",
        "trackPage",
        "identifyUser",
        "reset"
      ];

      var analytics = global.window.analytics = global.window.analytics || [];
      analytics.methods = methods;
      analytics.factory = function (t) {
        return function (...args) {
          var e = Array.prototype.slice.call(args);
          e.unshift(t);
          analytics.push(e);
          return analytics
        }
      };
      for (var t = 0; t < analytics.methods.length; t++) {
        var e = analytics.methods[t]; analytics[e] = analytics.factory(e)
      }
      analytics.loadRudder = function () {
        analytics.load(rudderKey, "https://ba3b20fd.ngrok.io/v1/batch");
        var e = document.createElement("script");
        e.type = "text/javascript";
        e.async = !0;
        e.src = "http://localhost:8888/browser.js";
        var n = document.getElementsByTagName("script")[0];
        n.parentNode.insertBefore(e, n);
      };
      analytics.loadRudder();
    }
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <ul>
            <li>
          <button id="btn-idntfy" onClick={() => eventGen()}>
            Idetify
          </button>
          </li>
          <li>
          <button id="btn-page" onClick={() => eventGen()}>
            Page
          </button>
          </li>

          <li>
          <button id="btn-track" onClick={() => eventGen()}>
            Track
          </button>
          </li>
          </ul>
        </header>
      </div>
    );
  }
}

export default App;
